import Playlist from "./components/Playlist"
import Footer from "./components/Footer"
import {Routes,Route} from "react-router-dom"



function App() {
  return (
    <>
      <Header></Header>
      <Routes>
        <Route path='/' element={<Home></Home>} />
        <Route path='/About' element={<Home></Home>} />
        <Route path='/' element={<Home></Home>} />
        <Route path='/' element={<Home></Home>} />
      </Routes>
    </>
  );
}

export default App;
